create table #tempMovimentacao (numero varchar(30))


select pm.CriadoEm, 
   pm.AlteradoEm, 
   pm.Integrado, 
   pm.IdSolicitacaoCaptura, 
   pm.Numero, 
   tm.numero 
  from #tempMovimentacao tm
  join ProcessoMovimento pm on pm.Numero = tm.numero 
 where cast(pm.AlteradoEm AS DATE) >= '2021-12-14'
 order by pm.AlteradoEm desc


drop table #tempMovimentacao
